description:
Location: Los Angeles, California
Lexington is a very pretty and natural beauty who was eager to shoot and show what she could do. She's also very sweet and intelligent...this is a smart girl. Tall and leggy and about as passable as possible. She's also a organist - like she plays the organ - which I thought was pretty cool. We had a great time shooting and she opened up very quickly. She's eager to work more.


